import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.scss';
import App from './App';

// This is the entry point of our React application
// It finds the 'root' div in the HTML and renders our App component there
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* StrictMode helps catch potential problems during development */}
    <App />
  </React.StrictMode>
);
